import { GlobalStyle, Section } from "./styles/GlobalStyles";

function App() {
  return (
    <>
      <Section>
        <h1>Hello World</h1>
        <h1>Something went good</h1>
      </Section>

      <GlobalStyle />
    </>
  );
}

export default App;
